    return (
        <>
            <DefaultSection>
                <SectionTitle>
                    Our Team
                </SectionTitle>
                <CenteredText>
                    Our company is ran by the best and brightest team in the industy.
                </CenteredText>

            </DefaultSection>
        </>
    );
}

export default PartnersContent;
